import{_ as e,c as t,o as i,ah as s}from"./chunks/framework.DYJPYqf_.js";const b=JSON.parse('{"title":"💡使用 Notepad++ 快速提取 SQL 表名的技巧","description":"","frontmatter":{},"headers":[],"relativePath":"notepad/sql.md","filePath":"notepad/sql.md","lastUpdated":1763791543000}'),d={name:"notepad/sql.md"};function l(r,a,o,h,n,c){return i(),t("div",null,[...a[0]||(a[0]=[s('<h1 id="💡使用-notepad-快速提取-sql-表名的技巧" tabindex="-1">💡使用 Notepad++ 快速提取 SQL 表名的技巧 <a class="header-anchor" href="#💡使用-notepad-快速提取-sql-表名的技巧" aria-label="Permalink to “💡使用 Notepad++ 快速提取 SQL 表名的技巧”">​</a></h1><p>在日常开发或数据分析中，我们常常需要从大量 SQL 语句中提取出涉及的表名，进行统计、优化或重构。本文将介绍如何使用 Notepad++ 的正则表达式功能，快速从 SQL 文件中提取表名，提升效率。</p><hr><h2 id="🧠-常见-sql-表名提取场景" tabindex="-1">🧠 常见 SQL 表名提取场景 <a class="header-anchor" href="#🧠-常见-sql-表名提取场景" aria-label="Permalink to “🧠 常见 SQL 表名提取场景”">​</a></h2><p>SQL 中的表名通常出现在以下几类语句中：</p><table tabindex="0"><thead><tr><th>SQL 类型</th><th>示例语句</th><th>表名位置</th></tr></thead><tbody><tr><td>SELECT</td><td><code>SELECT * FROM users WHERE id = 1;</code></td><td><code>FROM users</code></td></tr><tr><td>JOIN</td><td><code>INNER JOIN orders ON users.id = orders.uid</code></td><td><code>JOIN orders</code></td></tr><tr><td>INSERT</td><td><code>INSERT INTO products (name, price) VALUES...</code></td><td><code>INTO products</code></td></tr><tr><td>UPDATE</td><td><code>UPDATE customers SET name = &#39;Tom&#39;</code></td><td><code>UPDATE customers</code></td></tr><tr><td>DELETE</td><td><code>DELETE FROM logs WHERE time &lt; NOW()</code></td><td><code>FROM logs</code></td></tr></tbody></table><hr><h2 id="🛠-操作步骤-使用-notepad-提取表名" tabindex="-1">🛠 操作步骤：使用 Notepad++ 提取表名 <a class="header-anchor" href="#🛠-操作步骤-使用-notepad-提取表名" aria-label="Permalink to “🛠 操作步骤：使用 Notepad++ 提取表名”">​</a></h2><h3 id="_1️⃣-打开-notepad-并加载-sql-文件" tabindex="-1">1️⃣ 打开 Notepad++ 并加载 SQL 文件 <a class="header-anchor" href="#_1️⃣-打开-notepad-并加载-sql-文件" aria-label="Permalink to “1️⃣ 打开 Notepad++ 并加载 SQL 文件”">​</a></h3><p>将你的 SQL 文件拖入 Notepad++，或直接粘贴 SQL 内容。</p><h3 id="_2️⃣-打开-查找-窗口" tabindex="-1">2️⃣ 打开“查找”窗口 <a class="header-anchor" href="#_2️⃣-打开-查找-窗口" aria-label="Permalink to “2️⃣ 打开“查找”窗口”">​</a></h3><ul><li>快捷键：<code>Ctrl + F</code></li><li>切换到“查找”或“查找全部”标签页</li><li>在底部选择“搜索模式” → 勾选“正则表达式”</li></ul><h3 id="_3️⃣-输入正则表达式提取表名" tabindex="-1">3️⃣ 输入正则表达式提取表名 <a class="header-anchor" href="#_3️⃣-输入正则表达式提取表名" aria-label="Permalink to “3️⃣ 输入正则表达式提取表名”">​</a></h3><p>根据不同语句类型，使用以下正则表达式：</p><h4 id="✅-提取-select-delete-中的表名" tabindex="-1">✅ 提取 SELECT / DELETE 中的表名 <a class="header-anchor" href="#✅-提取-select-delete-中的表名" aria-label="Permalink to “✅ 提取 SELECT / DELETE 中的表名”">​</a></h4><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>(?i)\\bFROM\\s+([a-zA-Z0-9_]+)</span></span></code></pre></div><h4 id="✅-提取-insert-into-表名" tabindex="-1">✅ 提取 INSERT INTO 表名 <a class="header-anchor" href="#✅-提取-insert-into-表名" aria-label="Permalink to “✅ 提取 INSERT INTO 表名”">​</a></h4><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>(?i)\\bINTO\\s+([a-zA-Z0-9_]+)</span></span></code></pre></div><h4 id="✅-提取-update-表名" tabindex="-1">✅ 提取 UPDATE 表名 <a class="header-anchor" href="#✅-提取-update-表名" aria-label="Permalink to “✅ 提取 UPDATE 表名”">​</a></h4><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>(?i)\\bUPDATE\\s+([a-zA-Z0-9_]+)</span></span></code></pre></div><h4 id="✅-提取-join-表名" tabindex="-1">✅ 提取 JOIN 表名 <a class="header-anchor" href="#✅-提取-join-表名" aria-label="Permalink to “✅ 提取 JOIN 表名”">​</a></h4><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>(?i)\\bJOIN\\s+([a-zA-Z0-9_]+)</span></span></code></pre></div><blockquote><p>📌 提示：<code>(?i)</code> 表示忽略大小写，<code>[a-zA-Z0-9_]+</code> 匹配表名（字母、数字、下划线）</p></blockquote><h3 id="_4️⃣-查看匹配结果" tabindex="-1">4️⃣ 查看匹配结果 <a class="header-anchor" href="#_4️⃣-查看匹配结果" aria-label="Permalink to “4️⃣ 查看匹配结果”">​</a></h3><p>点击“查找全部”或“在当前文档中查找”，Notepad++ 会列出所有匹配项，表名会显示在结果中。</p><hr><h2 id="🔍-进阶技巧" tabindex="-1">🔍 进阶技巧 <a class="header-anchor" href="#🔍-进阶技巧" aria-label="Permalink to “🔍 进阶技巧”">​</a></h2><ul><li>如果表名带有反引号或双引号，可使用更宽容的表达式：<div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>(?i)\\bFROM\\s+[`&quot;]?([a-zA-Z0-9_]+)[`&quot;]?</span></span></code></pre></div></li><li>可结合“替换”功能，将表名提取出来并保存为新文件。</li><li>若需批量去重或统计表名频次，建议导出结果后使用 Excel 或脚本处理。</li></ul><hr><h2 id="🧩-总结" tabindex="-1">🧩 总结 <a class="header-anchor" href="#🧩-总结" aria-label="Permalink to “🧩 总结”">​</a></h2><p>使用 Notepad++ 的正则表达式功能，可以高效地从 SQL 中提取表名，适用于代码审查、数据库分析、重构等场景。无需借助复杂工具，轻量级编辑器也能完成强大的文本处理任务。</p>',31)])])}const k=e(d,[["render",l]]);export{b as __pageData,k as default};
